(11, 'UNs Jean Pierre Lacroix thanks India for contribution to peacekeeping', 6, 8, '<p>UNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeepingUNs Jean Pierre Lacroix thanks India for contribution to peacekeeping<br></p>', '2023-03-10 10:29:09', '2023-03-28 05:13:11', 0, 'UNs-Jean-Pierre-Lacroix-thanks-India-for-contribution-to-peacekeeping', '27095ab35ac9b89abb8f32ad3adef56a.jpg'),
(12, 'Shah holds meeting with NE states leaders in Manipur', 6, 7, '<p><span style=\"color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">New Delhi: BJP president Amit Shah today held meetings with his party leaders who are in-charge of 11 Lok Sabha seats spread across seven northeast states as part of a drive to ensure that it wins the maximum number of these constituencies in the general election next year.</span><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><webviewcontentdata style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">Shah held separate meetings with Lok Sabha toli (group) of Arunachal Pradesh, Tripura, Meghalaya, Mizoram, Nagaland, Sikkim and Manipur in Manipur, the partys media head Anil Baluni said.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">Baluni said that Shah was in West Bengal for two days before he arrived in Manipur. The BJP chief would reach Odisha tomorrow.</webviewcontentdata><br></p>', '2023-03-10 10:30:09', '2023-03-28 05:13:11', 0, 'Shah-holds-meeting-with-NE-states-leaders-in-Manipur', '7fdc1a630c238af0815181f9faa190f5.jpg');
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(13, 'KT win T1 ????', 6, 7, '<h2 data-field=\"sapo\" data-role=\"sapo\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; list-style: none; border: 0px; font-size: 15px; color: rgb(82, 80, 80); font-weight: bold; font-family: Tahoma;\">(Tổ Quốc) - Dù đã rơi xuống nhánh thua nhưng phía KT rất tự tin vào việc gặp lại và chiến thắng T1 trong tương lai.</h2><div data-check-position=\"gamek_detail_position_start\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 12px; outline-style: initial; outline-width: 0px; color: rgb(51, 51, 51); font-family: Tahoma;\"></div><p><zone id=\"admzonek9yy7w7l\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: Tahoma; font-size: 12px;\"></zone><span style=\"color: rgb(51, 51, 51); font-family: Tahoma; font-size: 12px;\"></span></p><div class=\"rightdetail_content detailsmallcontent\" data-field=\"body\" data-role=\"content\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; line-height: 23px; outline-style: initial; outline-width: 0px;\"><p style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\">Vào ngày 25/3 vừa qua, KT Rolster (KT) đã bị&nbsp;<a class=\"seo-suggest-link\" href=\"https://gamek.vn/t1.html\" target=\"_blank\" title=\"t1\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">T1</a>&nbsp;đánh bại với tỷ số 2-3 tại vòng loại (playoffs)&nbsp;<a class=\"seo-suggest-link\" href=\"https://gamek.vn/lck-mua-xuan-2023.html\" target=\"_blank\" title=\"LCK Mùa Xuân 2023\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">LCK Mùa Xuân 2023</a>. Kết quả này khiến KT rơi xuống nhánh thua, đối thủ của họ sẽ là đội thất bại trong trận đấu giữa Hanwha Life Esports (HLE) và Gen.G Esports (Gen.G) sắp tới.</p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\">Mặc dù thất bại nhưng&nbsp;<a class=\"seo-suggest-link\" href=\"https://gamek.vn/kt.html\" target=\"_blank\" title=\"KT\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">KT</a>&nbsp;lại nhận được rất nhiều lời khen từ phía khán giả. Lý do tới từ việc KT đã thể hiện vượt trên mức kỳ vọng của nhiều người và khiến T1 phải rất vất vả mới có thể giành chiến thắng. Điều này đã đem tới cho ban huấn luyện cũng như các thành viên KT sự tự tin rất lớn vào phần còn lại của giai đoạn playoffs.<br style=\"margin: 0px; padding: 0px; list-style: none;\"></p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\"><i style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">“Các tuyển thủ của chúng tôi đã chơi rất tốt ở giai đoạn đầu trận và tạo ra nhiều lợi thế. T1 dường như không có phương án đủ tốt để đấu lại với Twisted Fate nên đây là vị tướng chìa khóa dẫn tới chiến thắng. Hơn nữa, T1 cũng gặp khó khi Cuzz chủ động tấn công liên tục. Với những màn trình diễn vừa qua, chúng tôi tự tin là có thể vào Chung kết và thắng T1”</i>&nbsp;- HLV Supreme của KT chia sẻ.</p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; text-align: center; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\">Khi nhìn lại trận đấu vừa qua, khán giả sẽ thấy rằng KT thường là đội chủ động tấn công còn T1 sẽ tìm cách phản ứng lại. Lối chơi này đã khiến T1 thất bại ở ván 2 và ván 4 khi họ để đối thủ có được Twisted Fate cùng với những tướng Đi Rừng tấn công mạnh. Lối chơi tấn công chủ động này giúp KT phá vỡ được thế kiểm soát bản đồ mà T1 tìm cách thiết lập.<img src=\"data:image/webp;base64,\" style=\"width: 50%;\" data-filename=\"lol.webp\"></p><p style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; text-align: center; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\"><span style=\"font-size: 14px; font-style: italic; background-color: rgb(233, 233, 233);\">Việc kết hợp Twisted Fate và tướng Đi Rừng có khả năng tấn công mạnh đã giúp KT hạ gục T1 ở ván 2 và ván 4</span></p><p style=\"text-align: center; margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px;\"><div style=\"text-align: left;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px;\">Đương nhiên, KT vẫn còn một vấn đề lớn cần giải quyết đó là tâm lý của các tuyển thủ. Các tuyển thủ phía KT dường như không giữ được sự tập trung ở giai đoạn cuối trận và có những pha xử lý sai lầm. T1 đã tận dụng tốt điều này để đẩy KT xuống dưới nhánh thua. Vì vậy nếu muốn gặp lại hay xa hơn là hạ gục T1, phía KT cần giúp tuyển thủ vượt qua rào cản tâm lý để đạt được mục tiêu này.</span><font color=\"#333333\" face=\"Times New Roman\"><i><br></i></font></div><br></p></div>', '2023-03-27 15:29:23', '2023-03-27 15:30:25', 1, 'KT-win-T1-????', 'bcc5667786d6bd1b25e7c4d8a42e8550.jpg');
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(14, 'Laptop MSI Modern 15 A11M', 2, 10, '<p><span style=\"color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px;\">Đầu tiên, khi nhìn vào chiếc laptop MSI Modern 15 thì bạn sẽ bị thu hút bởi thiết kế hiện đại mà MSI đã mang lên chiếc máy này. Dù là một chiếc laptop giá rẻ nhưng MSI đã không vì thế mà làm chiếc MSI Modern 15 trông rẻ tiền, ngược lại bạn sẽ bị chinh phục bởi sự chỉnh chu và độ chi tiết đến mức tỉ mỉ của máy.&nbsp;</span></p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Laptop MSI Modern 15 A11M có khung thân cứng cáp nhờ được hoàn thiện từ hợp kim nguyên khối cao cấp, điều mà ít có một chiếc máy nào trong tầm giá làm được. Với tổng thể chắc chắn thì MSI Modern 15 sẽ đem lại sự bền bỉ và chống chịu được các tác động mạnh trong quá trình sử dụng mà không bị hư hỏng linh kiện bên trong.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Gam màu xám đen được làm nhám càng tôn lên sự hiện đại của máy, tổng thể của máy trông khá tối giản với thiết kế liền mạch, logo MSI được đặt ở mặt trước mang lại tính nhận diện cao.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Là một chiếc laptop thuộc phân khúc ultrabook nên MSI Modern 15 có một thiết kế tổng thể rất nhỏ gọn. Dù sở hữu màn hình lên đến 15.6 inch nhưng chiếc laptop văn phòng này sở hữu thông số kích thước và trọng lượng khá ấn tượng, máy chỉ nặng vỏn vẹn 1.6kg và độ mỏng 1.69 mm.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Với những bạn sinh viên, nhân viên văn phòng có nhu cầu công việc và học tập phải thường xuyên di chuyển và mang máy đi nhiều nơi thì laptop MSI Modern 15 sẽ rất thích hợp với bạn. Nhờ vào trọng lượng nhẹ và kích thước nhỏ gọn thì chiếc máy này sẽ là một người bạn đồng hành lý tưởng của bất kỳ ai, kể cả đối với những bạn nữ “chân yếu tay mềm”.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Cũng cần lưu ý, với màu xám nhám của máy thì việc Modern 15 dễ bị bám vân tay trong quá trình sử dụng là không thể tránh khỏi, điều này cũng không quá quan trọng đúng không nào.&nbsp;</p><h2 style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 26px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; color: rgb(34, 34, 34); font-weight: bold; font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif; line-height: 1.35;\">2. Cấu hình laptop MSI Modern 15 A11M đa nhiệm nhiều tác vụ<span class=\"ez-toc-section-end\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word;\"></span></h2><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Laptop MSI Modern 15 A11M 1024VN được trang bị một tùy chọn cấu hình khá tiêu chuẩn ở thời điểm hiện tại và hiệu năng của máy vẫn có thể giúp bạn đảm đương các tác vụ ổn định trong vòng vài năm tới.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Đầu tiên là về CPU, laptop MSI Modern 15 A11M được trang bị bộ vi xử lý Intel Core i5 Tiger Lake 1155G7 quốc dân đã liên tục xuất hiện trên những chiếc laptop tầm trung trong năm vừa qua. Con chip i5 1155G7 sở hữu 4 nhân và 8 luồng cho tốc độ trung bình 2.5GHz và đạt xung nhịp tối đa lên đến 4.5 GHz Turbo Boost.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Khi thực hiện bài test đơn nhân và đa nhân của&nbsp;<a href=\"https://phongvu.vn/cpu-core-i5-scat.02-N003?attributes.cpu_series=1566\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"margin: 0px; padding: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(3, 137, 255); text-decoration-line: underline;\">Intel core i5</a>&nbsp;Gen 11 trên phần mềm Cinebench R23 thì con chip này còn cho điểm số mạnh mẽ hơn người đàn anh i7 Gen 10 của năm trước. Cụ thể, Intel Core i5 Tiger Lake 1155G7 có điểm đơn nhân và đa nhân lần lượt là 1433 điểm và 5736 điểm.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Với hiệu năng tương đối ổn định của CPU thì bạn có thể thoải mái sử dụng máy cho các tác vụ văn phòng một cách mượt mà, ngoài ra thì MSI Modern 15 A11M cũng có thể đảm nhiệm tốt các tác vụ nặng như chỉnh sửa hình ảnh, dựng video đơn giản.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Card đồ họa tích hợp Intel Iris Xe Graphics từ nhà Intel đã quá nổi tiếng về hiệu năng xử lý các tác vụ hình ảnh. Bên cạnh phục vụ tốt cho nhu cầu học tập và làm việc thì chiếc card đồ họa này còn mang đến khả năng giải trí với các tựa game nhẹ quen thuộc như LOL, PUBG,…&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Về RAM thì bạn sẽ được trang bị một thanh RAM 8GB với tốc độ siêu nhanh 3200Mhz đem đến khả năng đa nhiệm tuyệt vời. Bên cạnh đó, máy còn cho phép bạn nâng cấp dễ dàng lên đến 64GB RAM với 2 khe chuẩn DDR4 2 khe (1 khe 8 GB + 1 khe rời).</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">512GB SSD sẽ là trang bị rất cần thiết hiện nay để bạn có thể lưu trữ tài liệu, các tài nguyên cần thiết khi làm việc một cách thoải mái.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"color: rgb(34, 34, 34); font-size: 26px; font-weight: bold;\">3. Màn hình rộng đem lại khả năng làm việc và giải trí vượt trội</span><br></p><h2 style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 26px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; color: rgb(34, 34, 34); font-weight: bold; font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif; line-height: 1.35;\"><span class=\"ez-toc-section-end\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word;\"></span></h2><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Laptop MSI Modern 15 A11M 1024VN được trang bị một chiếc màn hình có kích thước lên đến 15.6 inch và độ phân giải Full HD (1920 x 1080). Một điều khá đáng khen về màn hình của MSI Modern 15 đó chính là thiết kế màn hình với 3 cạnh viền siêu mỏng đem lại cảm giác cao cấp trên những chiếc laptop đắt tiền. Theo công bố từ hãng thì chiếc màn hình này có góc nhìn lên đến 178 độ nhờ sở hữu tấm nền IPS.Màn hình trên MSI Modern 15 A11M 1024VN đạt 65% sRGB , 49% Adobe RGB, độ phổ màu khá tương đối, đi kèm với đó là tần số quét 60Hz. Với những nhu cầu làm việc chuyên nghiệp cần độ chuẩn màu sắc cao thì có thể chiếc laptop này sẽ chưa thể đáp ứng được hoàn hảo cho bạn nhưng nó vẫn thể hiện rất tốt với nhu cầu giải trí và phục vụ những tác vụ thông thường.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Chúng ta không thể khắt khe về màn hình trên chiếc máy này vì với mức giá chỉ 15 triệu thì bạn khó có thể tìm được một sự lựa chọn nào tốt hơn.&nbsp;</p><h2 style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 26px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; color: rgb(34, 34, 34); font-weight: bold; font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif; line-height: 1.35;\"><span class=\"ez-toc-section\" id=\"4_Ban_phim_va_he_thong_loa_cua_laptop_MSI_Modern_15_A11M\" ez-toc-data-id=\"#4_Ban_phim_va_he_thong_loa_cua_laptop_MSI_Modern_15_A11M\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word; scroll-margin-top: 30px;\"></span>4. Bàn phím và hệ thống loa của laptop MSI Modern 15 A11M<span class=\"ez-toc-section-end\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word;\"></span></h2><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">MSI đã trang bị cho chiếc laptop MSI Modern 15 một chiếc bàn phím với layout cơ bản và không có bàn phím số, một điều khá đáng tiếc dù chiếc máy này có kích thước lớn tận 15.6 inch.&nbsp;</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Cảm giác soạn thảo và gõ chữ trên chiếc bàn phím này khá mượt mà và êm ái, hành trình phím cũng khá sâu và có độ phản hồi tốt. Để giúp người dùng làm việc dễ dàng hơn trong điều kiện thiếu sáng thì MSI cũng đã tích hợp đèn nền cho chiếc bàn phím này.</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Dải loa của laptop MSI Modern 15 A11M cũng được mình đánh giá khá cao khi được tích hợp công nghệ giả lập âm thanh vòm&nbsp;<a href=\"https://vn.msi.com/page/nahimic\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"margin: 0px; padding: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(3, 137, 255); text-decoration-line: underline;\">Nahimic Audio</a>&nbsp;giúp đem lại âm thanh khá sống động.&nbsp;</p><h2 style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 26px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; color: rgb(34, 34, 34); font-weight: bold; font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif; line-height: 1.35;\"><span class=\"ez-toc-section\" id=\"5_Cong_ket_noi_va_thoi_luong_pin\" ez-toc-data-id=\"#5_Cong_ket_noi_va_thoi_luong_pin\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word; scroll-margin-top: 30px;\"></span>5. Cổng kết nối và thời lượng pin<span class=\"ez-toc-section-end\" style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline; background: transparent; overflow-wrap: break-word;\"></span></h2><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Laptop MSI Modern 15 A11M mang lại khả năng kết nối các thiết bị ngoại vi một cách dễ dàng và tiện lợi với hầu hết các cổng kết nối thông dụng hiện nay như 2 cổng USB 3.2, cổng HDMI, USB 2.0 và USB Type-C.</p><p style=\"margin-bottom: 25px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; font-size: 16px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; overflow-wrap: break-word; line-height: 1.8em; color: rgb(68, 68, 68); font-family: system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Laptop MSI Modern 15 A11M-1024VN&nbsp; được trang bị một viên pin có dung lượng lên đến 52Wh nên bạn có thể yên tâm sử dụng chiếc máy này xuyên suốt ngày dài mà không sợ hết pin. Theo công bố từ hãng MSI thì viên pin của máy có thể hoạt động liên tục trong suốt 8-9 tiếng liên tục cùng khả năng sạc nhanh chỉ khoảng 3 giờ.&nbsp;<br></p><p><br></p>', '2023-03-27 15:34:19', NULL, 1, 'Laptop-MSI-Modern-15-A11M', '751c3da1739052dfcc5bbd2e5c94b08d.png');
